import './header.css';
import {Link} from 'react-router-dom'

function Header(){
    return(
        <header>
            <Link className='logo'  to="/">Prie Flix</Link>
            <Link className='favoritos' to="/favoritos">Meu filmes</Link>
        </header>
    )
}

export default Header;
